import Link from 'next/link';

const UsersList = ()=>(
<div>
    <Link href="/User?name=Mehmet" as="/user/Mehmet">
        <a className="username">Mehmet Seven</a>
    </Link><br/>
    <Link href="/User?name=Ahmet" as="/user/Ahmet">
        <a className="">Ahmet</a>
    </Link>

<style jsx>{`
    .username2{
        backround:black;
        color:white
    }
`}</style>
</div>
)
export default UsersList;
